from main import app
from fastapi.testclient import TestClient
from typing import List
from fastapi import Response, HTTPException
from uuid import UUID,uuid4

client = TestClient(app)

def test_base_URL():
    response = client.get("/")
    assert response.status_code == 200
    assert response.json() == "Hello Dropbox!\n"

def test_get_image():
    response = client.post("/base64", json={"image": ""})
    assert response.status_code == 201
    assert type(response.json()['data']) == type(['str','str1'])
 
def test_lawyer_endpoint():
    # Define test data
    user_data = "Sample user data"
    legal_document = "Sample legal document"
    session_id = str(uuid4())

    # Perform a POST request to the /lawyer endpoint
    response = client.post(
        "/lawyer",
        json={
            "user_data": user_data,
            "legal_document": legal_document
        },
        headers={"cookie": session_id},
        cookies={"cookie": session_id}
    )

    # Assert the response status code is 201
    assert response.status_code == 201

    # Assert the response content is a string (as specified in response_model)
    assert isinstance(response.text, str)    